var swiper=new Swiper(".swiper",{breakpoints:{320:{slidesPerView:1.25,spaceBetween:10},640:{slidesPerView:2.25,spaceBetween:20},992:{slidesPerView:3.25,spaceBetween:20},1200:{slidesPerView:4.25,spaceBetween:30}}});const palindrome=e=>{const l=e.toLowerCase().replace(/[^0-9a-z]/gi,"").split("");for(let e=0;e<l.length/2;e++)if(l[e]!==l[l.length-1-e])return!1;return!0};console.log(palindrome("_level"));const multiplyAll=e=>e.reduce(((e,l)=>e*l),1);console.log(multiplyAll([1,2,3,4]));const wordsToMarks=e=>[...e].reduce(((e,l)=>e+(l.charCodeAt()-96)),0);console.log(wordsToMarks("hello"));